import React from 'react';
import '../stylesheets/home.css';
import store from "../store";



console.log(store.getState())

const Tasks = (store) => store.getState().todos.map(i =>
    <li>{i}</li>
)

function Home() {
    return (

            <ol>
                {Tasks(store)}
            </ol>
    );
}

export default Home;
